import {OperationResult, PopupContainer, Preloader, PreloaderText, Result} from "./PopupStyled";
import React, {useState} from "react";

interface PopupProps {
    popupFlag: boolean,
    message: string,
    operationResult: boolean
}

const Popup = (props:PopupProps) => {
    const [isSuccess, setIsSuccess] = useState(props.operationResult)



    console.log(isSuccess)
    return(
        <PopupContainer visible={props.popupFlag}>
            <OperationResult>
                <Preloader/>
                <Result/>
                <PreloaderText>{props.message}</PreloaderText>
            </OperationResult>
        </PopupContainer>
    )
}

export default Popup
